Director: Eddie Powell
Starring: August Ames , Cherie DeVille , Callie Calypso , Siri , Danny Mountain , Ryan McLane , Xander Corvus , Richie Calhoun

Cherie and Ryan, whose careers cause them to spend less time together than apart, seek exciting ways to keep their sexual attraction hot between visits. In appreciation for her husband's thoughtful, romantic gestures, Callie decides to explore some more taboo adventures in the bedroom. Roleplaying becomes the perfect recipe for seduction after Siri and Richie meet up at a bar for a pretend, 'first time encounter.' August, a seemingly sweet and innocent young bride, surprises her husband, Danny with a steamy afternoon filled with handcuffs, blindfolds, and a leather whip.

